import React, {useState, useEffect} from 'react';
import Stack from '@mui/material/Stack';
import Button from '@mui/material/Button';
import axios from 'axios'

function Dashboard() {
  const[ordini, setOrdini] = useState([])
  useEffect(() => {
      axios.get('http://127.0.0.1:8000/ordinazioni/',[])
      .then(res => {
          console.log(res)
          setOrdini(res.data)
      },)
      .catch(err =>{
          console.log(err)
      })
  },[])
  return (
     
    <div className='row dashboard'>
      
      {
          ordini.map(ordini =>  <Stack spacing={14} direction="row" justifyContent="center"
          alignItems="center">
           {ordini.nome_prenot} - {ordini.totale}
          <Button variant="outlined" size='small'>Accettato</Button>
          
          </Stack>
          
         )
      }
     
    </div>
    
  );
}

export default Dashboard;
